void StringFacility::split(string const s, vector<string>& tokens, string const& delimiters) noexcept
{
    tokens.clear();
    string::size_type position = 0;
    while(true)
    {
        string::size_type tokenStart = s.find_first_not_of(delimiters, position);
        if(tokenStart == string::npos) break;
        string::size_type tokenEnd = s.find_first_of(delimiters, tokenStart);
        if(tokenEnd != string::npos)
        {
            string token = s.substr(tokenStart, tokenEnd - tokenStart);
            tokens.push_back(token);
            position = tokenEnd;
            continue;
        }
        else
        {
            string token = s.substr(tokenStart);
            tokens.push_back(token);
            break;
        }
    }
}

void StringFacility::ltrim(string& s, string const& wsChars) noexcept
{
    string::size_type pos = s.find_first_not_of(wsChars);
    if(pos != string::npos)
    {
        s.erase(0, pos);
    }
    else
    {
        s.clear();
    }
}

void StringFacility::rtrim(string& s, string const& wsChars) noexcept
{
    string::size_type pos = s.find_last_not_of(wsChars);
    if(pos != string::npos)
    {
        s.erase(pos + 1);
    }
    else
    {
        s.clear();
    }
}

void StringFacility::trim(string& s, string const& wsChars) noexcept
{
    ltrim(s, wsChars);
    rtrim(s, wsChars);
}

void StringFacility::toupper(string& s) noexcept
{
    transform(s.begin(), s.end(), s.begin(), ::toupper);
}

void StringFacility::tolower(string& s) noexcept
{
    transform(s.begin(), s.end(), s.begin(),::tolower);
}

bool StringFacility::match(string const& s, string const& pattern, bool ignoreCase)
{
    std::regex_constants::syntax_option_type ft = regex_constants::ECMAScript;
    if(ignoreCase) ft |= regex_constants::icase;
    regex r(pattern, ft);
    return regex_match(s, r);
}

bool StringFacility::startsWith(string const& s, string const& start, bool ignoreCase)
{
    string _s = s;
    string _start = start;
    if(ignoreCase)
    {
        StringFacility::tolower(_s);
        StringFacility::tolower(_start);
    }
    return (_s.compare(0, _start.length(), _start) == 0);
}

bool StringFacility::endsWith(string const& s, string const& end, bool ignoreCase)
{
    string _s = s;
    string _end = end;
    if(ignoreCase)
    {
        StringFacility::tolower(_s);
        StringFacility::tolower(_end);
    }
    if(_s.length() < _end.length()) return false;

    return (_s.compare(_s.length() - _end.length(), _end.length(), _end) == 0);
}

int StringFacility::findAndReplace(string& s, string const& f, string const& r)
{
    int n = 0;
    for(string::size_type i = 0; (i = s.find(f, i)) != string::npos;)
    {
        s.replace(i, f.length(), r);
        i += r.length();
        n ++;
    }
    return n;
}

static inline bool _transformFromUtf8ToUnicode(const char* s, size_t length, uint32_t offset, uint32_t& unicode, uint32_t& skipBytes) noexcept
{
    // first byte;
    char first = s[offset];
    skipBytes = 1;
    if((first & 0x80) == 0)
    {
        unicode = first & 0xff;
        return true;
    }
    else if((length < 2) || ((first & 0xc0) == 0x80))
    {
        return false;
    }

    // second byte;
    char second = s[offset + 1];
    if((second & 0xc0) != 0x80)
    {
        return false;
    }
    skipBytes = 2;
    if((first & 0xe0) == 0xc0)
    {
        unicode = ((first & 0x1f) << 6) | (second & 0x3f);
        return (unicode >= 0x80);
    }
    if(length < 3) return false;

    // third byte;
    char third = s[offset + 2];
    if((third & 0xc0) != 0x80) return false;
    skipBytes = 3;
    if((first & 0xf0) == 0xe0)
    {
        unicode = ((first & 0x0f) << 12) | ((second & 0x3f) << 6) | (third & 0x3f);
        return (unicode >= 0x0800);
    }
    if(length < 4) return false;


    // fourth byte;
    char fourth = s[offset + 3];
    if((fourth & 0xc0) != 0x80) return false;
    skipBytes = 4;
    if((first & 0xf8) == 0xf0)
    {
        unicode = ((first & 0x07) << 18) | ((second & 0x3f) << 12) | ((third & 0x3f) << 6) | (fourth & 0x3f);
        return (unicode >= 0x10000);
    }
    return false;
}

vector<uint32_t> StringFacility::transformFromUtf8ToUnicode(const char* s, size_t length, uint32_t& invalidBytes) noexcept
{
    uint32_t offset = 0;
    uint32_t unicode;
    uint32_t skipBytes;
    invalidBytes = 0;
    vector<uint32_t> unicodes;
    while(offset < length)
    {
        bool b = _transformFromUtf8ToUnicode(s, length, offset, unicode, skipBytes);
        if(b)
        {
            unicodes.push_back(unicode);
        }
        else
        {
            invalidBytes += skipBytes;
        }
        offset += skipBytes;
    }

    return unicodes;
}

static inline void _transformFromUnicodeToUtf8(uint32_t unicode, char* s, uint32_t& bytes) noexcept
{
    if(unicode < 0x80)
    {
        s[0] = (char)unicode;
        bytes = 1;
        return;
    }
    else if(unicode < 0x0800)
    {
        s[0] = 0xc0 | (unicode >> 6);
        s[1] = 0x80 | (unicode & 0x3f);
        bytes = 2;
        return;
    }
    else if(unicode < 0x10000)
    {
        s[0] = 0xe0 | (unicode >> 12);
        s[1] = 0x80 | ((unicode >> 6) & 0x3f);
        s[2] = 0x80 | (unicode & 0x3f);
        bytes = 3;
        return;
    }
    else if(unicode < 0x110000)
    {
        s[0] = 0xf0 | (unicode >> 18);
        s[1] = 0x80 | ((unicode >> 12) & 0x3f);
        s[2] = 0x80 | ((unicode >> 6) & 0x3f);
        s[3] = 0x80 | (unicode & 0x3f);
        bytes = 4;
        return;
    }
    bytes = 0;
}

string StringFacility::transformFromUnicodeToUtf8(vector<uint32_t> const& unicodes) noexcept
{
    string s;
    char buff[2052];
    uint32_t buffOffset = 0;
    uint32_t bytes;
    for(uint32_t i = 0; i < unicodes.size(); i ++)
    {
        if((buffOffset & 0xf800) != 0) // > 0x7ff = 2047
        {
            buff[buffOffset] = '\0';
            s += buff;
            buffOffset = 0;
        }
        _transformFromUnicodeToUtf8(unicodes[i], buff + buffOffset, bytes);
        buffOffset += bytes;
    }
    if(buffOffset > 0)
    {
        buff[buffOffset] = '\0';
        s += buff;
    }
    return s;
}

bool StringFacility::isUcs2Printable(uint16_t unicode) noexcept
{
    unsigned int q = (unicode >> 3);
    unsigned int m = (unicode & 0x07);
    return ((NONPRINTABLE_CHARACTER_FLAGS[q] & ((char)1 << m)) == 0);
}

string StringFacility::washUtf8(string const s) noexcept
{
    uint32_t invalidBytes;
    vector<uint32_t> unicodes = StringFacility::transformFromUtf8ToUnicode(s.c_str(), s.length(), invalidBytes);
    vector<uint32_t> _unicodes;
    _unicodes.reserve(unicodes.size());
    for(uint32_t i = 0; i < unicodes.size(); i ++)
    {
        if(unicodes[i] > 0xffff) continue;
        if(isUcs2Printable((uint16_t)unicodes[i])) _unicodes.push_back(unicodes[i]);
    }
    return StringFacility::transformFromUnicodeToUtf8(_unicodes);
}
